import React from 'react';
import styled from 'styled-components';

const TagListBlock = styled.div`
  width: 45%;
  height: 300px;
  border: 1px solid black;
`;

const TagList = () => {
  return <TagListBlock>태그</TagListBlock>;
};

export default TagList;
